query GetRooms($modelId: ID!) {
  model(id: $modelId) {
    id
    rooms {
      ...RoomDetails
      __typename
    }
    __typename
  }
}

fragment RoomDetails on ModelRoom {
  id
  meshId
  floor {
    id
    meshId
    __typename
  }
  dimensions {
    height
    width
    depth
    areaFloor
    __typename
  }
  tags
  __typename
}
